13.2 原因：

快速遍历是根据enumerator对象内部的计数器，调用nextObject方法来返回下一个数组元素。这种方式，一开始应当一次就把所有额enumerator对象全部创建好了，如果此时删除数组中一个元素，enumerator是不会reset的，即后面enumeration会找不到对应的数组元素，造成crash


