4> 逆序遍历，查找后删除
正序时，如果删除一个，则后方未遍历的位置会向前移动一位，这样后面可能会有enumerator找不到数组元素造成crash
逆序时，如果删除一个，改变的是后方元素（已经遍历过），对于未遍历的则没有影响
